import React from 'react';
import { Wrapper, Content} from './Header.styles'
import logo from '../../Images.logo.svg'

const Header = () => (
    <Wrapper>
        <Content>
            <LogoImg src={logo} alt='main-logo' />
        </Content>
    </Wrapper>
)

export default Header;
